import Header from './components/Header.js';
import Auth from './components/Auth.js';

import { UseSelector } from 'react-redux';

function App() {
  const isAuthenticated = UseSelector((state) => state.auth.isAuthenticated);

  return (
    <>
    <Header />
    <Auth />
    <Counter />
    </>
  );
}

export default App;
